import React, { useEffect } from "react";
import { SiReact, SiIonic, SiAngular, SiJava, SiSpring, SiFirebase, SiGit, SiJenkins, SiAdobexd, SiAdobe, SiAdobeillustrator } from "react-icons/si";
import Overlay from "./Overlay";

const Myskills = () => {
  const skills = [
    { icon: <SiReact fontSize="40px" color="#61DBFB" />, title: "React Native" },
    { icon: <SiIonic fontSize="40px" color="#4E8EF7" />, title: "Ionic" },
    { icon: <SiAngular fontSize="40px" color="#DD0031" />, title: "Angular" },
    { icon: <SiJava fontSize="40px" color="#007396" />, title: "Java" },
    { icon: <SiSpring fontSize="40px" color="#6DB33F" />, title: "Spring Boot" },
    { icon: <SiFirebase fontSize="40px" color="#FFCA28" />, title: "Firebase" },
    { icon: <SiGit fontSize="40px" color="#F05032" />, title: "Git" },
    { icon: <SiJenkins fontSize="40px" color="#D24939" />, title: "Jenkins" },
    { icon: <SiAdobexd fontSize="40px" color="purple" />, title: "Adobe XD" },
    { icon: <SiAdobe fontSize="40px" color="#FF0000" />, title: "Adobe Photoshop" },
    { icon: <SiAdobeillustrator fontSize="40px" color="#FF7A00" />, title: "Adobe Illustrator" },
  ];

  useEffect(() => {
    // Your code that uses the openMenu variable
  }, []); // Add dependencies if needed

  return (
    <div id="my-skills" className="mt-16">
      <h2 className="text-center text-xl border-b border-gray-300 font-bold pb-2">
        My Skills
      </h2>
      <div className="flex flex-wrap justify-center mt-8">
        {skills.map((skill, index) => (
          <div key={index} className="text-center m-4">
            {skill.icon}
            <h6 className="text-sm mt-2">{skill.title}</h6>
          </div>
        ))}
      </div>
      <Overlay />
    </div>
  );
};

export default Myskills;
